import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Navbar from './Navbar';

const App = (props) => {

  return (
    <Router> 
      <Switch>
        <Route path = '/' component = {Navbar}></Route>
              </Switch>
    </Router>
  );

}

export default App;
